import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import FilterExpenses from "./FilterExpenses";
const Expenses = ({ expenses, filterExpenses }) => {
  return (
    <div>
      <FilterExpenses />
      <Card>
        {expenses.map((item) => (
          <ExpenseItem
            key={item.title}
            title={item.title}
            amount={item.amount}
            date={item.date}
          />
        ))}
      </Card>
    </div>
  );
};

export default Expenses;
